import React from 'react';
import { Navbar, Nav, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './navBar.css';
import Container from 'react-bootstrap/Container';

function NavigationBar() {
  return (
    <>
    <div className='main'>
      <Navbar bg="light" variant="light" className="custom-navbar">
        <Container className='container'>
          <Navbar.Brand href="#home" className="mr-auto">TeamUp</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="button">
            <Nav.Link className='button' href="#home">LogIn</Nav.Link>
            <Nav.Link href="#features">SignUp</Nav.Link>
          </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      </div>
    </>
  );
}

export default NavigationBar;
